import React from "react";

const TableChoferesBodyRow = ({ id, nombre, ci }) => {
  return (
    <>
      <tr>
        <td>{id}</td>
        <td>{nombre}</td>
        <td>{ci}</td>
        <td>Niger</td>
        <td>Oud-Turnhout</td>
      </tr>
    </>
  );
};

export default TableChoferesBodyRow;
